from typing import List
class Solution:
    def maximumLengthOfRanges(self, nums: List[int]) -> List[int]:
        N = len(nums)
        left_idx = [None] * N
        right_idx = [None] * N
        stack = list()
        for i in range(N):
            if not stack or nums[stack[-1]] > nums[i]:
                left_idx[i] = i
            else:
                while stack and nums[stack[-1]] < nums[i]:
                    stack.pop()
                if stack:
                    left_idx[i] = stack[-1] + 1
                else:
                    left_idx[i] = 0
            stack.append(i)
        stack = list()
        for i in range(N-1, -1, -1):
            if not stack or nums[stack[-1]] > nums[i]:
                right_idx[i] = i
            else:
                while stack and nums[stack[-1]] < nums[i]:
                    stack.pop()
                if stack:
                    right_idx[i] = stack[-1] - 1
                else:
                    right_idx[i] = N - 1
            stack.append(i)
        res = [None] * N
        for i in range(N):
            res[i] = right_idx[i] - left_idx[i] + 1
        return res

